"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Seasonal allergies in adults (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/seasonal-allergies-in-adults-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H566815453\">",
"      <span class=\"h1\">",
"       What are seasonal allergies?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Seasonal allergies, also called &ldquo;hay fever,&rdquo; are a group of conditions that can cause sneezing, a stuffy nose, or a runny nose. Symptoms occur only at certain times of the year. Most seasonal allergies are caused by:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Pollens from trees, grasses, or weeds (",
"        <a class=\"graphic graphic_figure graphicRef77269 \" href=\"mobipreview.htm?22/59/23477\">",
"         figure 1",
"        </a>",
"        )",
"       </li>",
"       <li>",
"        Mold spores, which grow when the weather is humid, wet, or damp",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Normally, people breathe in these substances without a problem. When a person has a seasonal allergy, his or her immune system acts as if the substance is harmful to the body. This causes symptoms.",
"     </p>",
"     <p>",
"      Many people first get seasonal allergies when they are children or young adults. Seasonal allergies are life-long, but symptoms can get better or worse over time. Seasonal allergies sometimes run in families.",
"     </p>",
"     <p>",
"      Some people have symptoms like those of seasonal allergies, but their symptoms last all year. Year-round symptoms are usually caused by:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Insects, such as dust mites and cockroaches",
"       </li>",
"       <li>",
"        Animals, such as cats and dogs",
"       </li>",
"       <li>",
"        Mold spores",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H566815460\">",
"      <span class=\"h1\">",
"       What are the symptoms of seasonal allergies?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Symptoms of seasonal allergies can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Stuffy nose, runny nose, or sneezing a lot",
"       </li>",
"       <li>",
"        Itchy or red eyes",
"       </li>",
"       <li>",
"        Sore throat, or itching of the throat or ears",
"       </li>",
"       <li>",
"        Waking up at night or trouble sleeping, which can lead to feeling tired during the day",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H566815467\">",
"      <span class=\"h1\">",
"       Is there a test for seasonal allergies?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor will ask about your symptoms and do an exam. He or she might order other tests, such as a skin test. A skin test can help figure out what you are allergic to. During a skin test, a doctor will put a drop of the substance you might be allergic to on your skin, and make a tiny prick in the skin. Then, he or she will watch your skin to see if it turns red and bumpy.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H566815474\">",
"      <span class=\"h1\">",
"       How are seasonal allergies treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People with seasonal allergies might use one or more of the following treatments to help reduce their symptoms:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Nose rinses",
"        </strong>",
"        &ndash; Rinsing out the nose with salt water cleans the inside of the nose and gets rid of pollen in the nose. Different devices can be used to rinse the nose.",
"       </li>",
"       <li>",
"        <strong>",
"         Steroid nose sprays",
"        </strong>",
"        &ndash; Doctors often prescribe these sprays first, but it can take days to weeks before they work. (Steroid nose sprays do not contain the same steroids that athletes take to build muscle.)",
"       </li>",
"       <li>",
"        <strong>",
"         Antihistamines",
"        </strong>",
"        &ndash; These medicines help stop itching, sneezing, and runny nose symptoms. Some antihistamines can make people feel tired.",
"       </li>",
"       <li>",
"        <strong>",
"         Decongestants",
"        </strong>",
"        &ndash; These medicines can reduce stuffy nose symptoms. People with certain health problems, such as high blood pressure, should not take decongestants. Also, people should not use decongestant nose sprays for more than 3 days in a row. Using these nose sprays for more than 3 days in a row can make symptoms worse.",
"       </li>",
"       <li>",
"        <strong>",
"         Allergy shots",
"        </strong>",
"        &ndash; Some people with seasonal allergies choose to get allergy shots. Usually, allergy shots are given every week or month by an allergy doctor. Many people find that this treatment reduces their symptoms, but it can take months to work.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Talk with your doctor or nurse about the benefits and downsides of the different treatments. The right treatment for you will depend a lot on your symptoms and other health problems. It is also important to talk with your doctor or nurse about when and how to use your medicines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H566815481\">",
"      <span class=\"h1\">",
"       Can seasonal allergy symptoms be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If you get symptoms at the same time every year, talk with your doctor or nurse. Some people can prevent symptoms by starting their medicine a week or two before that time of the year.",
"     </p>",
"     <p>",
"      You can also help prevent symptoms by avoiding the things you are allergic to. For example, people who are allergic to pollen can:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Stay inside during the times of the year when they have symptoms",
"       </li>",
"       <li>",
"        Keep car and house windows closed, and use air conditioning instead",
"       </li>",
"       <li>",
"        Take a shower before bed to rinse pollen off their hair and skin",
"       </li>",
"       <li>",
"        Wear a dust mask if they need to be outside",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H566815488\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you want to get pregnant, talk with your doctor about which medicines are safe for pregnant women to take. Seasonal allergy symptoms can get worse, get better, or stay the same in pregnant women.",
"     </p>",
