"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Name of product (manufacturer)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CVS Pharmacy St. John's Wort (CVS Pharmacy, Inc.)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Kira&reg; St. John's Wort Lichtwer Pharma Exclusive LI 160&reg; Formula (ABKit Inc.)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nature's Way Perika St. John's Wort (Nature's Way Products, Inc.)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rite Aid St. John's Wort (Rite Aid Corporation)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vitamin Shoppe St. John's Wort Extract (The Vitamin Shoppe)",
"       </td>",
"      </tr>",
"      <tr>",
